import React, { Component } from "react";

const Like = () => {
	const { liked, onClick } = this.props;
	handleLike = (x) => {
		if (!x) return "fa fa-heart-o";
		else return "fa fa-heart";
	};
	return (
		<i
			onClick={onClick}
			style={{ cursor: "pointer" }}
			className={this.handleLike(liked)}
			aria-hidden='true'
		/>
	);
};

export default Like;
